import React from 'react';

function Faculty() {
  return (
    <div className='facultyFilter'>
      <h4>Faculty</h4>
      
      <select id="faculty">
        <option value="">Select the faculty</option>
        <option value="Kohli">Kohli</option>
        <option value="Singh">Singh</option>
        <option value="David">David</option>
        <option value="Chopra">Chopra</option>
        <option value="Kalaam">Kalaam</option>
        <option value="Sharma">Sharma</option>
      </select>
    </div>
  );
}

export default Faculty;
